import React from 'react';
import logo from './logo.svg';
import './App.css';

function Paragraph() {
  return(<p>hello</p>)
}

function App() {
  const paragraph = <p>hello</p>
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to fuck bitches.
        </p>
        <Paragraph/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
